import React, {useState, useEffect} from "react";
import axios from "axios";

const TodoList = () => {
    const [todos, setTodos] = useState();

    //When the todo list is being rendered this useEffect will run
    useEffect(() => {
        //make an axios get request to the given URL
        //when the request is done the todos is set to the response data from the URL 
        axios.get(`https://jsonplaceholder.typicode.com/todos`).then((res) => {
            const responseTodos = res.data;
            setTodos(responseTodos);
        })
    }, []);

    return (
        <div>
            <h1>Todo List</h1>
            {/* If todos is defined */}
            {todos && todos.map(todo => {
                const {id, userId, title} = todo;
                return (
                    <div key = {id}>
                        <h5>{title}</h5>
                        <h6>Assigned to user: {userId}</h6>
                    </div>
                )
            })}
        </div>
    )
}

export default TodoList;
